// src/Crew.js
import React from 'react';
import './Crew.css';

const Crew = () => {
  return (
    <div className="crew-container">
      <h1 className="retro-title">Friends Cast & Crew</h1>

      <section className="crew-section">
        <h2>Cast</h2>
        <ul className="crew-list">
          <li>Jennifer Aniston as Rachel Green</li>
          <li>Courteney Cox as Monica Geller</li>
          <li>Lisa Kudrow as Phoebe Buffay</li>
          <li>Matt LeBlanc as Joey Tribbiani</li>
          <li>Matthew Perry as Chandler Bing</li>
          <li>David Schwimmer as Ross Geller</li>
        </ul>
      </section>

      <section className="crew-section">
        <h2>Crew</h2>
        <ul className="crew-list">
          <li>David Crane - Co-Creator</li>
          <li>Marta Kauffman - Co-Creator</li>
          <li>Kevin S. Bright - Executive Producer</li>
          <li>Michael Lembeck - Director</li>
          <li>Gregory S. Malins - Writer</li>
          <li>Adam Chase - Writer</li>
        </ul>
      </section>
    </div>
  );
};

export default Crew;
